import swal from "sweetalert"
import axios from "axios";
import { useState,useEffect }  from "react";
import { useNavigate, useParams} from "react-router-dom";
const URI = "http://localhost:8080/prestamo/"


//sessionStorage.setItem("usuario",
//sessionStorage.setItem("clave",123456);
let headers = {
    "usuario" : sessionStorage.getItem("usuario"),
    "clave"   : sessionStorage.getItem("clave")
  };

const MostrarPrestamo = () => {
    const navigate = useNavigate();
    const [prestamos, setPrestamos] = useState([])
    useEffect(() =>{
        getPrestamos()
    })
    const {id} = useParams()
    const getPrestamos = async () =>{
        try {
            
            const res = await axios({
                method : "GET",
                url : URI + "consulta_prestamo?idp="+id,
                headers: headers 
               
            });
            
            setTransacciones(res.data)
            
            //console.log(clientes)
        }
        catch (error) {
            alert("No tiene Acceso a esta Opción");
            navigate("/");
        }
    }

     
return(
        <div className='container'>
            <div className='row'>
                <div className='col'>
                    <table className='table'>
                        <thead className='table-primary'>
                            <tr>
                                <th>Id</th>
                                <th>Fecha</th>
                                <th>Valor</th>
                                <th>Tipo</th>
                            </tr>
                        </thead>
                        <tbody>
                            { prestamos.map ( (prestamo) => (
                                <tr key={ prestamo.id_prestamo}>
                                    <td> { prestamo.id_prestamo } </td>
                                    <td> { prestamo.fecha_solicitud } </td>
                                    <td> { prestamo.saldo_solicitado } </td>
                                    <td> { prestamo.n_cuotas } </td>
                                    <td> { prestamo.n_cuotas } </td>
                                    <td> { prestamo.n_cuotas } </td>
                                    "id_prestamo": 123,
    "fecha_solicitud": "2023-07-26",
    "saldo_solicitado": 500000.0,
    "n_cuotas": 5,
    "valor_cuota": 100000.0,
    "saldo_pendiente": 398250.0,
                                </tr>
                            )) }
                        </tbody>
                    </table>
                </div>    
            </div>
        </div>
    );
};

export default MostrarTransaccion;
